import '../styles/tailwind.css'

export default function Govbins({ Component, pageProps }) {
  return (
    <React.Fragment>
      <header>
        <h1 className="text-5xl">
          #govbins
      </h1>
      </header>
      <Component {...pageProps} />
    </React.Fragment>
  )
}
